import React from "react";
import { View, Text, Image, SafeAreaViewBase,StyleSheet,StatusBar,TouchableOpacity} from "react-native";
import {useNavigation} from "@react-navigation/native"
 



export default function Inicio() {
    const navigation=useNavigation()
    return (
        <SafeAreaViewBase>
            <Text>Empresa Olho Singelo</Text>
            <Text>Endereço:País:Brasil – São Paulo – Cidade:Bauru – Rua:Jose Vicente Aiello 13129
                Telefone: (14) 32343536 ou (14) 996767848
                Email: emilio.malungo@hotmail.com
            </Text>

        </SafeAreaViewBase>
    )
}
